window.bookSummaryJSON = "<p>Do you have a grip on your business, or does your business have a grip on you? </p> <p>All entrepreneurs and business leaders face similar frustrations: personnel conflict, profit woes, and inadequate growth. Decisions never seem to get made, or once made, fail to be properly implemented. But there is a solution. It’s not complicated or theoretical. </p> <p>The Entrepreneurial Operating System is a practical method for achieving the business success you have always envisioned. More than 2,000 companies have discovered what EOS can do. </p> <p> In<i>Traction</i>, you’ll learn the secrets of strengthening the six key components of your business. You’ll discover simple yet powerful ways to run your company that will give you and your leadership team more focus, more growth, and more enjoyment. Successful companies are applying Traction every day to run profitable, frustration-free businesses - and you can too.</p>"; 
